        "text" : "Hallo Marc. Ich kann das leider nicht beeinflussen, das ist ein automatischer Ablauf. Es werden keine Rechnungen mit einem Betrag unter CHF 25.- erstellt. Deine Rechnungen werden immer zu Beginn des Monats generiert und du zahlst sie nach ein paar Tagen auch ein. Nur f√ºr die letzte Rechnung vom 6. August 2019 hast du CHF 234.- eingezahlt anstatt CHF 112.10. Deshalb wurde die September-Rechnung nicht generiert worauf du erneut eine Zahlung √ºber CHF 122.- am 6. September 2019 ausgel√∂st hast.\n\nWie gesagt, die n√§chste Rechnung erfolgt sobald das Guthaben aufgebraucht ist und die Monate September, Oktober und November 2019 werden abgerechnet. Es erfolgt auch keine Mahnung, du kannst ohne weiteres auf die n√§chste Rechnung abwarten.\n\nDanke f√ºr dein Verst√§ndnis. LG, ^sz",
